  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides preliminary liquefaction
  susceptibility maps for the metro Boise area. Liquefaction occurs during strong
  earthquake ground shaking when saturated, coheionsless earth materials lose strength
  because of high excess pore-water pressure. The database was produced using 1) a
  standard methodology relating deposit age, texture (grain size and sorting), and
  environment of deposition to liquefaction susceptibility, and, 2) depth to the local
  water table. The database uses 1:100,000-scale geologic map information and water
  well records. The water well data have uncertainities in data quality and location.
  For these reasons, this product is not suited for detailed engineering use. On-site
  geotechnical studies are required to establish actual liquefaction potential for
  any specific location. It is best used as a regional screening tool to focus further
  attention on areas with apparently high liquefaction hazards.\",\n\t\"license_title\":
